// src/PackageDetail.js
import React from 'react';
import { useParams } from 'react-router-dom';

const PackageDetail = () => {
  const { packageId } = useParams();

  // Aquí puedes definir el contenido para cada paquete. 
  // Puedes usar un objeto que contenga la información de los paquetes.
  const packages = {
    cordoba: {
      title: "Cordoba",
      description: "Paquete para 8 personas en Córdoba.",
      price: "$1500 - Valor por persona.",
      details: "Detalles adicionales sobre el paquete de Córdoba."
    },
    salta: {
      title: "Salta",
      description: "Paquete para 8 personas en Salta.",
      price: "$1550 - Valor por persona.",
      details: "Detalles adicionales sobre el paquete de Salta."
    },
    chapelco: {
      title: "Patagonia",
      description: "Paquete para 8 personas en Patagonia.",
      price: "$1600 - Valor por persona.",
      details: "Detalles adicionales sobre el paquete de Patagonia."
    }
  };

  const paquete = packages[packageId];

  return (
    <div className="container my-5">
      {paquete ? (
        <div>
          <h2>{paquete.title}</h2>
          <p>{paquete.description}</p>
          <p>{paquete.price}</p>
          <p>{paquete.details}</p>
        </div>
      ) : (
        <p>Paquete no encontrado.</p>
      )}
    </div>
  );
};

export default PackageDetail;
